import React from 'react';
import Footer from '../Components/Footer';
import Header from '../Components/Header';

export default function Home() {
  return(
    <>
      <Header />
      <main>
      <h3>Vem conhecer nosso Espaço</h3>
      <p>Para quem nunca teve contato com Arte Marcial, oferecemos uma aula particular gratuita com um de nosssos professores. Em um ambiente confortável, com infra estrutura completa e uma equipe de alto nível, você terá uma experiência incomparável!</p>
      <div>
          <h2>Thomas Bryan</h2>
          <p>Thomas Bryan Lopes Galvão tem 22 anos, sou atual representante no Acre de uma das maiores escolas de  <strong>Muay Thai</strong> e <strong>MMA</strong> do mundo "Chute Boxe"</p>
          <p>Iniciou sua jornada nas artes marciais na academia Evolution Sport Center com o mestre <strong>Renato Silva</strong> responsável por trazer a bandeira Chute Boxe para o Acre. Foram 8 anos de muito aprendizado na qual o fez colecionar inúmeros resultados expressivos nas competições tornando o centro de treinamento referência no Muay Thai e MMA do Acre.</p>
          <p>Além da metodologia que forma grandes atletas eu pude aprender com o Mestre Renato a importância das artes marciais na promoção da saúde, com isso quando iniciou sua jornada como professor. Buscando sempre oferecer um ótimo atendimento a seus alunos buscou conhecimentos acadêmicos se graduando no curso de <strong>Educação Física Bacharelado do Centro Universitário Uninorte</strong>, referência em educação física no Acre, assim unindo os conhecimentos técnicos do Muay Thai com os conhecimentos academicos, auxilia os alunos do Evolution Sport Center a alcançar seus objetivos tanto  competitivo como na promoção da Saúde.</p>
        </div><div>
          <h2>Thomas Bryan</h2>
          <p>Thomas Bryan Lopes Galvão tem 22 anos, sou atual representante no Acre de uma das maiores escolas de  <strong>Muay Thai</strong> e <strong>MMA</strong> do mundo "Chute Boxe"</p>
          <p>Iniciou sua jornada nas artes marciais na academia Evolution Sport Center com o mestre <strong>Renato Silva</strong> responsável por trazer a bandeira Chute Boxe para o Acre. Foram 8 anos de muito aprendizado na qual o fez colecionar inúmeros resultados expressivos nas competições tornando o centro de treinamento referência no Muay Thai e MMA do Acre.</p>
          <p>Além da metodologia que forma grandes atletas eu pude aprender com o Mestre Renato a importância das artes marciais na promoção da saúde, com isso quando iniciou sua jornada como professor. Buscando sempre oferecer um ótimo atendimento a seus alunos buscou conhecimentos acadêmicos se graduando no curso de <strong>Educação Física Bacharelado do Centro Universitário Uninorte</strong>, referência em educação física no Acre, assim unindo os conhecimentos técnicos do Muay Thai com os conhecimentos academicos, auxilia os alunos do Evolution Sport Center a alcançar seus objetivos tanto  competitivo como na promoção da Saúde.</p>
        </div>
     </main>
      <Footer />
    </>
  );
}
